const ChooseSexButton = ({ handleButton, sex }) => {
  const caption = "";
  if (sex === "f") {
    caption = "Female";
  } else if (sex === "m") {
    caption = "male";
  }
  return <button onClick={() => handleButton(sex)}>{caption}</button>;
};

export default ChooseSexButton;
